import React from "react";

 function CountryComponent(props) {
  const { name, region, currency, president, image } = props.infos;
  return (
    <div>
      <h1>Car details</h1>
      <p>name: {name}</p>
      <p>region: {region}</p>
      <p>currency: {currency}</p>
      <p>president: {president}</p>
      <p>image: {image}</p>
      <hr />
    </div>
  );
}
export default CountryComponent;
